package org.katie.parrot.examples;

import static org.mockito.ArgumentMatchers.*;
import static org.mockito.Mockito.doReturn;

import java.lang.RuntimeException;
import org.mockito.Mockito;
import org.parrot.core.serde.DefaultSerde;
import org.parrot.examples.ThrowExample;

public class MockErrorDiceCreator {
  private static final DefaultSerde defaultSerde = new DefaultSerde();

  public static ThrowExample.ErrorDice create() {
    RuntimeException runtimeException1 = (RuntimeException) defaultSerde.deserialize("");
    ThrowExample.ErrorDice mockErrorDice2 = Mockito.mock(ThrowExample.ErrorDice.class);
    doReturn(2).doReturn(2).doThrow(runtimeException1).doReturn(1).doReturn(4).when(mockErrorDice2).roll();
    return mockErrorDice2;
  }
}

